import { useState } from "react"

import { SelectDay, SelectProgram, SelectWorkout } from "./components"

export const WorkoutPage = () => {
    const [step, setStep] = useState(1)

    const renderCurrentStep = () => {
        switch(step){
            case 1:
                return (
                    <SelectProgram/>
                )
            case 2:
                return(
                    <SelectDay/>
                )
            default:
        }
    }
    return(
        <div>
            hello workout page - main
            {renderCurrentStep()}
        </div>
    )
}
